highlowApp.tooltip={init:function(o){$(".tooltip-container").each(function(){var i=$(this),n=$(i.children(".tooltip"));n.css({display:"none",opacity:0});var t;i.on("mouseover",function(){t=setTimeout(function(){n.css({display:"block"}),n.animate({opacity:1},250)},o)}).on("mouseout",function(){clearTimeout(t),n.animate({opacity:0},250,function(){n.css({display:"none"})})})})}};